var content_f3_16_3337=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F58379&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F58379&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 500px\">",
"   <div class=\"ttl\">",
"    Broth microdilution test of Candida glabrata at 48 hours",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 480px; height: 350px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Minimum inhibitory concentration (MIC) determinations can be made using standardized panels of antifungals in a 96-well plate. Wells of broth are inoculated with a concentrated antifungal solution in serial two-fold dilutions. All wells are then inoculated with a specified amount of the fungal suspension of interest, suspended in an equal volume, and incubated at a given temperature and for a given length of time. The tubes are then examined for turbidity, which represents fungal growth. The MIC is the first well that is clear or that shows a significant diminution in turbidity relative to the control well. For example, the MICs for rows A, B, and C are observed in A9, B8, and C9, respectively. Row H is the control well.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Michael Pfaller, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
