" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Associated disability and level of mental retardation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td>",
"       <strong>",
"        MILD (IQ 50-69):",
"       </strong>",
"       Capable of personal independence with a little guidance and assistance.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        MODERATE (IQ 35-49):",
"       </strong>",
"       Require assistance with more complex activities; communicate with simple sentences.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        SEVERE (IQ 20-34):",
"       </strong>",
"       Require assistance with most ADLs; communicate with words and gestures.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        PROFOUND (IQ &lt;20):",
"       </strong>",
"       Require comprehensive care and assistance; usually non-verbal; high incidence of secondary disabilities.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
