var title_f3_16_3341="Ddx LPL path";
var content_f3_16_3341=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F69760&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F69760&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Histology, immunophenotype, and genetic features of differential diagnosis of lymphoplasmacytic lymphoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Entity",
"       </td>",
"       <td class=\"subtitle1\">",
"        Histology",
"       </td>",
"       <td class=\"subtitle1\">",
"        Immunophenotype",
"       </td>",
"       <td class=\"subtitle1\">",
"        Genetic features/other",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lymphoplasmacytic lymphoma",
"       </td>",
"       <td>",
"        <p>",
"         &ge;10 percent infiltration by small lymphocytes, plasmacytoid lymphocytes, and plasma cells, with variable numbers of admixed immunoblasts.",
"        </p>",
"        <p>",
"         Characteristic (but not pathognomonic) hyperplasia of mast cells in marrow.",
"        </p>",
"        <p>",
"         Lymph nodes are usually diffusely effaced. Proliferation centers and marginal zone type differentiation are absent.",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Express pan B-cell antigens (CD19, CD20, CD22, CD79a). Most, but not all, cases fail to express CD5.",
"        </p>",
"        <p>",
"         Variable expression of CD11c, CD43, CD25. Most cases express IgM; fewer express IgG or IgA.",
"        </p>",
"        <p>",
"         CD10 and cyclin D1 are not expressed.",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Majority have a monoclonal IgM paraprotein.",
"        </p>",
"        <p>",
"         No specific chromosomal abnormalities.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic lymphocytic leukemia/small lymphocytic lymphoma",
"       </td>",
"       <td>",
"        \"Typical\" CLL/SLL cells are small mature appearing lymphocytes with a dense nucleus, partially aggregated chromatin, no discernible nucleoli, and a narrow border of clear to slightly basophilic cytoplasm.",
"       </td>",
"       <td>",
"        Always express CD5, usually CD23 positive. Dim expression of CD20 and surface Ig.",
"       </td>",
"       <td>",
"        Del13q, del 11q, del17p, trisomy 12",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B-cell prolymphocytic leukemia",
"       </td>",
"       <td>",
"        Prolymphocytes &gt;55 percent of the neoplastic cells. Bone marrow has interstitial pattern of infiltration. Lymph nodes may show vague nodularity, but proliferation centers are absent.",
"       </td>",
"       <td>",
"        Express bright surface IgM +/- IgD and bright CD20 as well as other B-cell antigens (CD19, CD22, CD79a, FMC7).",
"       </td>",
"       <td>",
"        <p>",
"         t(11;14) must be excluded.",
"        </p>",
"        <p>",
"         No associated paraproteinemia.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Follicular lymphoma",
"       </td>",
"       <td>",
"        Nodular growth pattern of follicle center cells (centrocytes and centroblasts).",
"       </td>",
"       <td>",
"        Typically express CD10, HLA-DR, pan B-cell antigens (CD19, CD20, CD79a), CD21, and surface IgM, IgG, or IgA.",
"       </td>",
"       <td>",
"        t(14;18)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Multiple myeloma",
"       </td>",
"       <td>",
"        Infiltration of plasma cells in the bone marrow.",
"       </td>",
"       <td>",
"        Surface Ig is absent. Express CD138, CD38, CD79a, and VS38c. Infrequently express CD19. Approximately 70 percent of myeloma cells will express CD56.",
"       </td>",
"       <td>",
"        Cytogenetics usually abnormal, although there is no specific cytogenetic abnormality.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mantle cell lymphoma",
"       </td>",
"       <td>",
"        Monomorphous small to medium-sized B lymphocytes with irregular nuclei.",
"       </td>",
"       <td>",
"        CD5+ and CD23-; typically co-express surface IgM and IgD; the vast majority over-express cyclin D1.",
"       </td>",
"       <td>",
"        t(11;14)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Marginal zone lymphoma",
"       </td>",
"       <td>",
"        Polymorphous infiltrate of small cells with paler-appearing marginal zone-type differentiation in lymph nodes.",
"       </td>",
"       <td>",
"        Expresses B cell markers CD19, CD20, and CD22, and not CD5, CD10, and CD23.",
"       </td>",
"       <td>",
"        <p>",
"         Chromosomal abnormalities, usually trisomy 3 or t(11;18), are found in most cases.",
"        </p>",
"        <p>",
"         May demonstrate mixed cryoglobulinemia +/- hepatitis C infection.",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     Ig: immunoglobulin.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
